# {{lb|en|mechanics}} A [[jet]] [[jump]] for [[lift]]ing water or [[withdraw]]ing air from a space.<!-- {Ejector condenser} ([[steam|Steam]] [[engine|Engine]]), a condenser in which the [[vacuum]] is maintained by a jet pump. -->{{attention|en|where do we put this?}}
